import Search from './Search';
function NavBar({onChange}){

    const changeToLoad=()=>{
        console.log("loanded");
    }
    return(
        <div className ="navBar">
            <div className="wrapper">
            <h2 className = "logo">asguard school library</h2>
            <div className = "navLinks">
                <ul>
                    <li className="active" onClick={onChange}><a href="#@">All Books</a></li>
                    <li><a href="#@" onClick={changeToLoad}>loans</a></li>
                    <li><a href="#@">recieve books</a></li>
                </ul>
            </div>
            <Search />
            </div>
        </div>
    )
}
export default NavBar;
